import React from 'react';
import '.././style/App.css';
import Sample from '.././feed/sample.json';

class Movies extends React.Component {

  state = {
      loading: true,
      movie: ""
    };

    async componentDidMount() {
      const requestOptions = {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.parse({ title: 'React POST Request Example' })
    };
      const response = await fetch({Sample},requestOptions);
      const data = await response.json();
      this.setState({ movie: data.entries, loading: false });
    }

  render(){

    return (

      <div>

        <div>{this.state.movie.title}</div>
      </div>
    );
  }
}

export default Movies;
